VR Motion Communications Team (MoCo Team) are passionate creators, producers, developers, engineers, gamers, sales people, and other professionals that want to change the way the world communicates online using the coolest, cutting-edge technology. VR Motion Communications (MoCo) itself is a revolutionary communication platform that will make the following:

next generation media communication content and services;
-the world’s first anonymous 3D Avatar Chat;
-4K/8K Live and Streaming Chat;
-other streaming services;
-Immersive 3DVR LiveVideo Chat.

BitEternity is a three-part public chain consisting of BitEternity Chain, BitEternity App and BitEternity chain digital assets;

It is a versatile blockchain App payment system that combines functions such as lightning payment transfer, P2P chat, digital asset trading, blockchain game and blockchain mall;

It is an ecosystem of links to digital assets and the global economy. The aim is to solve the problems of inconvenient user management of various digital assets, complicated transaction process, slow transaction confirmation, poor performance and insufficient application scenarios.

YB artificial intelligence visual recognition bio-blockchain project is a new high-tech project based on artificial intelligence combined with blockchain realized by AI technology. It promotes visual recognition of biotechnology landing and the protection of personal privacy data through the mining and circulation of the token. no need for third party verification KYC; mainly has the following characteristics:

       1. Guarantee user data privacy: achieve the highest level of data security through cryptographic techniques such as zero-knowledge proof, homomorphic encryption, and differential privacy;

       2. The data belongs to the user: the user has full ownership of the data, and the third party needs to be authorized by the user to use the data. The data obtained by the user's authorization will also receive good privacy protection. The technology of homomorphic encryption and secure multi-party computing will ensure that the data will not be leaked and copied during use, thus ensuring that the data belongs to the user completely and protects the user's interests;

      3. Face feature as a pass-through private key: based on YB's many years of face recognition technology and AI algorithm, it can accurately verify the identity of the user through the face and protect the account security;

      4. No need for third-party KYC: Resolve user identity authentication (KYC) issues that prevent blockchain applications from landing. With the user's consent, the YB Smart Pass is anchored with the real user identity to better connect the digital world and the real world. Based on zero-knowledge proof technology, user authentication does not affect user privacy under user authorization;

      5. The data is completely credible: based on the inability to modify and trace the blockchain to ensure the credibility of user data.

SEC is the first block chain project based on the trust relationship in the world to promote e-commerce socializing, decentralization, In view of the huge market demand, the SEC supports large concurrency. The overall structure of the SEC Network blockchain project is divided into three levels:

(1) The SEC Network underlying structure;

(2) As the middle layer, the SEC Network service layer provides the function of a transaction gateway, which is used for transactions such as that based on intra-chain and off-chain WEB protocols;

(3) The upper layer is the SEC Network application service layer, which provides the API interface, web application development and DAPP development frameworks; the underlying application capability.

The Agrolot Project is a decentralized B2B platform for international trade if agricultural crops and food products. It is currently running a crowdfunding campaign built on Blockchain technology featuring Smart Contracts. The innovation of this projects includes:

1. A simple conclusion of transactions by the use of smart-contracts and an ultimate execution;
2. Efficient and economic benefits to all trading participants within the trading transactions;
3. Secured and transparent transactions on the basis of blockchain and all its members.

The making this project was as a result of our experience in the market of international trade in products of agriculture and food stuffs. We have made all our businesses processes rational such as finance, logistics, storage, insurance. After testing all similar platforms, we have concluded that the majority of them offer services of the local nature and are not meant for real trading and getting real results, instead they are only informative. We give a critical solution in the global trade. It will allow both small and medium sized manufactures and buyers to reach mutually beneficial deals from all over the world. In addition to that we guarantee payment security by the use of smart contracts; delivering all goods to their destinations safely

CAI.TODAY aims to build the world's largest quiz platform, with a cumulative number of registered users reaching 800,000 in just a few months. It is expected that more than 3 million people will participate in the quiz during the World Cup and will continue to grow rapidly.

1. CAI.TODAY quiz platform, using blockchain technology, based on Ethereum ecological and smart contract, combined with the blockchain quiz platform built by industries such as sports events, finance, entertainment, games, etc., the world's first user to create quiz event business model .
2. The CAI.TODAY quiz platform is based on the decentralized concept and it will not be controlled by any direct stakeholder group. Ensure that all users are in a fair, open and fair game environment. At the same time, CAI.TODAY has created a unique mining and dividend model, and 80% of the platform’s revenue rewards users who participate in the contest, ensuring that all participants’ interests are maximized.
3. CAI.TODAY has reached strategic cooperation with many top agencies and media around the world, such as: FunCity Capital, OK Blockchain, Node Capital, Dragoon Capital, etc., which will promote CAI.TODAY to the world and create a globally valuable core product.

Industry&Facts & figures:
1. The official PC version and H5 version have been put into operation (official website address: https://cai.today/);
2. The content of the quiz has been part of the sporting events, including the five European leagues, the NBA, and the upcoming World Cup;
3. At present, ETH and CAI Token have been supported for quiz, and more types of tokens will be accessed later;
4. Later, more sports events and games, finance, entertainment and other quiz projects will be launched and the online APP version will be released.

GSC (Global Social Chain) is the world's first new generation of social networking chain that owns hundreds of millions of social users. This social chain is determined to use block chain technology to subvert centralized social networks such as Facebook, WeChat, etc., which plays a dual role as "manager" and "arbiter" simultaneously for the former social networking platforms.

Social network is the most important basic measure of the Internet. It conveys the user's daily high frequency interactive behavior. However, at present, all the centralized social networking platforms, such as Facebook, Snapchat, etc., are facing many pain points.

The security of users' private information cant be guaranteed;
The user data can be used by the platform at any time;
There is a lack of incentive as the values created within the content of the user belong, at last, to the platform;
Credit system vulnerability, false information, and low social efficiency.

The social network is a natural source applied to the centralized block chain technology. GSC's vision is to utilize the block chain technology to restructure the values of the next generation of social networking platforms and let the security of the private data and the digital assets become individual. Through the in-depth cooperation with the famous social networking application Mico, we have the chance to validate the solution of the block chain technology on the product matrix of Mico and made very effective progress.
